import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from "react";
import Login from './pages/Login'
import Home from "./components/Home";
function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
        <Route path="/home" element={<Home />} />
           <Route path="/login" element={<Login />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
